import React, { Fragment } from "react";
import data from "../data.json";
import {
  TodoListSection,
  TodoHeader,
  ListTitle,
  OtherBtn,
  ListUl,
  Radio,
  TodoLi,
  TodoText,
  DeleteBtn,
} from "../Style/ComponentStyle/TodoStyle";

export const Todo = ({ text }) => {
  console.log(data[0].title);
  return (
    <Fragment>
      <TodoLi>
        <Radio type={"radio"} />
        <TodoText>{text}</TodoText>
        <DeleteBtn src="img/close_btn.svg" alt="닫기 버튼"></DeleteBtn>
      </TodoLi>
    </Fragment>
  );
};

export const TodoList = () => {
  return (
    <Fragment>
      <TodoListSection>
        <TodoHeader>
          <ListTitle>{data[0].title}</ListTitle>
          <OtherBtn src="img/Other_btn.svg" />
        </TodoHeader>
        <ListUl>
          <Todo />
        </ListUl>
      </TodoListSection>
    </Fragment>
  );
};
